import React from 'react';
import './App.css';
import ProtectedRoute from './authentication/ProtectedRoute';
import Logout from './authentication/Logout'
import { Router } from '@reach/router';

import Login from './pages/Login'
import Register from './pages/Register'
import Dashboard from './pages/Dashboard'
import Course from './pages/Course'
import NewObjective from './pages/NewObjective'
import EditObjective from './pages/EditObjective'
import NewActivity from './pages/NewActivity'
import EditActivity from './pages/EditActivity'
import Profile from './pages/Profile';
import Lost from './pages/404'


function App() {
  return (
    <div>
        <Router>
          {/* <Route path = "/login"/>
          <Route path = "/register"/> */}
          <ProtectedRoute path = "/"/>
          <ProtectedRoute path = "/dashboard"/>
          <Course path = "/course/:id"/>
          <ProtectedRoute path = "/objective/new"/>
          <ProtectedRoute path = "/objective/edit"/>
          <ProtectedRoute path = "/activity/new"/>
          <ProtectedRoute path = "/activity/edit"/>
          <ProtectedRoute path = "/profile"/>
          <ProtectedRoute path='/logout'/>
          <ProtectedRoute path = "*" />
        </Router>
    </div>
  );
}


export default App;
